import { AiOutlineAlignLeft } from 'react-icons/ai';

function FilterAnimators() {
    return (
<div class="container-big">
		<div class="btn btn--white btn--icon filter-mob-btn">
			<AiOutlineAlignLeft></AiOutlineAlignLeft>Фильтры
		</div>
		<div class="filter" >
        font-family: "Nunito", "Segoe UI", "Helvetica Neue", Arial, sans-serif;
    font-size: 18px;
    font-weight: 600;
    line-height: 1.45;
    color: #1D1C21;
    text-align: center;
    box-sizing: border-box;
    margin: 0;
    -webkit-text-size-adjust: 100%;
    max-height: 5000em;
    align-items: flex-start;
    justify-content: space-between;
    background: #FFF;
    border-radius: 30px;
    box-shadow: 0 10px 40px 0 rgba(37, 22, 14, 0.2);
    margin-top: -50px;
    padding: 15px 30px 15px 30px;
    width: 100%;
    display: block;


<div class="filter-group">
	<div class="filter-group__title menu-14">&nbsp;</div>
	<div class="filter-group__list">
		<a href="/animatory/#filter_block" class="filter-group__list__item active">
			<span><mark>Все вместе</mark></span>
		</a>
	</div>
</div>

<div class="filter-group">
	<div class="filter-group__title menu-14">Для кого</div>
	<div class="filter-group__list">
								<a href="/animatory/malchik/#filter_block" class="filter-group__list__item ">
				<span><mark>Мальчик</mark></span>
			</a>
								<a href="/animatory/devochka/#filter_block" class="filter-group__list__item ">
				<span><mark>Девочка</mark></span>
			</a>
			</div>
</div>

<div class="filter-group">
	<div class="filter-group__title menu-14">Формат праздника</div>
	<div class="filter-group__list">
								<a href="/animatory/v-shkolu/#filter_block" class="filter-group__list__item ">
				<span><mark>В школы</mark></span>
			</a>
								<a href="/animatory/v-detskiy-sad/#filter_block" class="filter-group__list__item ">
				<span><mark>В детский сад</mark></span>
			</a>
			</div>
</div>
<div class="filter-group">
	<div class="filter-group__title menu-14">Возраст ребенка</div>
	<div class="filter-group__list">
								<a href="/animatory/3-4_goda/#filter_block" class="filter-group__list__item ">
				<span><mark>3-4 года</mark></span>
			</a>
								<a href="/animatory/5-6_let/#filter_block" class="filter-group__list__item ">
				<span><mark>5-6 лет</mark></span>
			</a>
								<a href="/animatory/7-8_let/#filter_block" class="filter-group__list__item ">
				<span><mark>7-8 лет</mark></span>
			</a>
								<a href="/animatory/9-10_let/#filter_block" class="filter-group__list__item ">
				<span><mark>9-10 лет</mark></span>
			</a>
			</div>
</div>		</div>
	</div>
    )
}

export default FilterAnimators;
